import React from "react";

const NavigationBar = ()=>{
    return(
        <div className="nav-container">
            <ul>
                <li><a href="#" className="petdairy-content">Pet Diary</a></li>
                <li><input type="text" placeholder="Search Id" /></li>
                <li><a href="#" className="admin-content">Admin</a></li>
            </ul>
        </div>
    )
}

export default NavigationBar;
